            <ul>
                <li><Link to="/farmer/login">Farmer Login</Link></li>
                <li><Link to="/buyer/login">Buyer Login</Link></li>
                <li><Link to="/logistics/login">Logistics Login</Link></li>
                {/* Add more links as needed */}
            </ul>
        </nav>
    );
};

export default Navigation;
